import Sunny from '../../image/Sunny.jpg'
import Rainy from '../../image/Rainy.jpg'
import "../index.css"
const Picture = ({selectedItem}) => {
    if(selectedItem.Guess){
        return <div >
            <img src={Sunny} alt="Sunny" style={{backgroundcolor: "blue"}}/>
        </div>
    }else{
        return <div >
            <img src={Rainy} alt="Rainy" style={{backgroundcolor: "gray"}}/>
        </div>
    }
    
}

export default Picture;
